import React from "react";
import {Row, Col} from "react-bootstrap"

const PlayerControls = props => {

    return (
        <div className="record-player-controls_container">
            <Row>
                <Col>
                    <div className="record-player-controls">
                        <PlaybackButton/>
                    </div>
                </Col>
            </Row>
        </div>
    )
}

export default PlayerControls;
